import './ActionPlanItem.scss';

function ActionPlanItem({number, text}) {

  return (
    <div className="actionPlanItem">
      <div className='actionPlanItem__number'><h3>{number}</h3></div>
      <div className='actionPlanItem__text'><h3>{text}</h3></div>
    </div>
  );
}

export default ActionPlanItem;
